    <ng-template #item let-item let-root="root">
      <ng-container *ngIf="item.route">
        <a [routerLink]="item.route" class="p-menubar-item-link">
          <span [class]="item.icon"></span>
          <span class="ml-1">{{ item.label }}</span>
        </a>
      </ng-container>
    </ng-template>
    <ng-template #end>
      <div class="cursor-pointer ring-4 ring-primary-600/30 rounded-xl p-1 hover:ring-primary-600/60" (click)="menu.toggle($event)">
        <div class="flex flex-row items-center gap-2">
          <span class="pi pi-angle-down"></span>
          <p>{{ clientDTO.username }}</p>
          <p-avatar image="profile_pictures/profile-{{clientDTO.profilePhoto}}.jpg" shape="circle" class="size-11"/>
        </div>
      </div>
      <p-menu #menu
              [model]="profileItems"
              [popup]="true"
              styleClass="mencus"/>
    </ng-template>
  </p-menubar>
</div>
